function Nav()
{
    return(
   <>
    <div>
    <ul>
        <li><a class="active" href="about.html">HOME</a></li>
        <li><a  href="artifical in.html">NEWS</a></li>
        <li><a  href="computer.html">ABOUT     </a></li>
        <li><a  href="opacity.html">CONTACT</a></li>
    </ul>
    </div>
   </> 
    )
            
}
       
    export default Nav;
